import { React } from "react";

import EventList from "./Events/EventsList";
import NavBar from "./NavBar/NavBar";

const Home = ({ location }) => {
  var showDonateState = false;

  console.log(location);
  console.log(location.state);
  console.log(location.state.showDonateState);
  if (location.state) {
    if (location.state.showDonateState) {
      showDonateState = location.state.showDonateState;
    }
  }
  return (
    <div>
      <NavBar />
      <EventList showDonateState={showDonateState} />
    </div>
  );
};

export default Home;
